import React, { useState } from "react";

export default () => {
  const [age, setAge] = useState("");
  const [name, setName] = useState("");
  return (
    <div>
      <div class="ui form">
        <div class="fields">
          <div class="field">
            <label>Name</label>
            <input
              onChange={(e) => setName(e.target.value)}
              value={name}
              type="text"
              placeholder="Name"
            />
          </div>
          <div class="field">
            <label>Age</label>
            <input
              onChange={(e) => setAge(e.target.value)}
              value={age}
              type="number"
              placeholder="Age"
            />
          </div>
        </div>
        <button className="ui button primary">Submit</button>
      </div>
    </div>
  );
};
